import React, { Component } from 'react';

const Base = (props) => {
  return ( 
    <React.Fragment>
      <div className="card" style={{MarginTop: "10px"}}>
        <div className="card-body">
          {props.children}
        </div>
      </div>
    </React.Fragment>
  );
}
 
export default Base;
